// client/src/helpers/statusLabels.js

const statusLabels = {
    cars: {
      owned: "Owned",
      wishlist: "Wishlist",
    },
    homes: {
      owned: "Owned",
      rented: "Rented",
      wishlist: "Wishlist",
    },
    concerts: {
      attended: "Attended",
      wishlist: "Wishlist",
    },
    travel: {
      visited: "Visited",
      wishlist: "Wishlist",
    },
    sports: {
      attended: "Attended",
      wishlist: "Wishlist",
    },
  };

  export default statusLabels;
